-- ----------------------------
-- View structure for `buyed_course_view`
-- ----------------------------
DROP VIEW IF EXISTS `buyed_course_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `buyed_course_view` AS (select `crxy`.`buyed_course`.`student_id` AS `student_id`,`crxy`.`student`.`realname` AS `student_name`,`crxy`.`course`.`name` AS `course_name`,`crxy`.`course`.`url` AS `course_url`,`crxy`.`tuition`.`logtime` AS `buy_time`,`crxy`.`tuition`.`advisor_id` AS `advisor_id` from (((`buyed_course` join `tuition` on((`crxy`.`buyed_course`.`tuition_id` = `crxy`.`tuition`.`id`))) join `student` on((`crxy`.`buyed_course`.`student_id` = `crxy`.`student`.`id`))) join `course` on((`crxy`.`buyed_course`.`course_id` = `crxy`.`course`.`id`)))) ;

-- ----------------------------
-- View structure for `course_show_view`
-- ----------------------------
DROP VIEW IF EXISTS `course_show_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `course_show_view` AS (select `crxy`.`course`.`id` AS `id`,`crxy`.`course`.`name` AS `name`,`crxy`.`course`.`style` AS `style`,`crxy`.`course`.`commission_style` AS `commission_style`,`crxy`.`course`.`value` AS `value`,`crxy`.`course`.`drm` AS `drm`,`crxy`.`course`.`url` AS `url`,`crxy`.`course`.`shichang` AS `shichang`,`crxy`.`course`.`zhaiyao` AS `zhaiyao`,`crxy`.`course`.`content` AS `content`,`crxy`.`course`.`teacher_id` AS `teacher_id`,`crxy`.`course`.`coach1` AS `coach1`,`crxy`.`course`.`status` AS `status`,`crxy`.`course`.`cms_show` AS `cms_show`,`crxy`.`teacher`.`name` AS `teacher_name` from (`course` left join `teacher` on((`crxy`.`course`.`teacher_id` = `crxy`.`teacher`.`id`))) where (`crxy`.`course`.`cms_show` = '显示')) ;
