INSERT INTO `question` VALUES ('19', '就业班', '现在企业招人都要求有工作经验，培训后没工作经验怎么找工作？', '答：工作经验不是非得参加工作才能获得。公司所要求的工作经验无非就是对技术运用的熟练程度和解决实际问题的能力，这些能力正是我们培训所要解决的问题。凭借我们的课程体系和教学质量，以及目前市场上对hadoop大数据人才的需求，相信找份hadoop工作并不难。', '2014-07-07 11:15:58');
INSERT INTO `question` VALUES ('17', '就业班', '很多公司招聘都要求本科学历，我是大专学历，可以找到hadoop工作吗？', '答：学历只是个敲门砖，只代表过去，学历高并不代表技术就有多牛逼。当然，大公司对学历要求会严格些，但小公司只要你的技术和解决问题的能力ok就行了。我们的学员中就有大专学历的，通过努力学习，同样可以找到高薪的hadoop工作。', '2014-07-07 11:15:53');
INSERT INTO `question` VALUES ('18', '就业班', 'hadoop目前只是大公司在搞，招聘需求太少，怎么办？', '答：大公司在大数据这块确实进入比较早，数据量尤其是互联网公司数据量非常大，所以需求自然多；有些学员入职的公司（比如电商公司）规模虽小，但数据量却不小，所以他们也在招hadoop大数据工程师。', '2014-07-07 11:15:48');
INSERT INTO `question` VALUES ('12', '就业班', '以上课程提供技术解答吗？解答有哪些形式？', '答：\r\n 无论哪类课程，只要报名成为会员，在学习过程中，如果遇到问题，都可以在群里提问，有技术辅导和助教帮忙解答的。\r\n形式有：qq群里回复、远程协助调试、电话指导等。', '2014-07-07 11:07:55');
INSERT INTO `question` VALUES ('13', '就业班', '授课形式是怎么样的？', '答：超人学院目前的课程都是网络课程，就业班是通过qq群在线授课的，上课时录屏，课后也有视频的。', '2014-07-07 11:08:38');
INSERT INTO `question` VALUES ('14', '就业班', '有视频可以试听吗？免费吗？', '答：有的，试听视频请到http://www.superwu.cn/2014/02/19/1159/下载，是免费的。', '2014-07-07 11:09:02');
INSERT INTO `question` VALUES ('15', '就业班', '学习hadoop大数据需要哪些基础？需要java web基础吗？', '答：需要javaSE基础，另外，懂linux基本的常用命令即可。不需要java web基础，java web和hadoop是两个方向的技术了。', '2014-07-07 11:09:29');
INSERT INTO `question` VALUES ('16', '就业班', '我不是计算机专业的能学好大数据技术吗？', '答：能不能学会，跟是不是计算机专业没有太大的关系，只能说计算机专业的因为以前学过，上手快一点，但并不代表他一定比你学的好。在我们的已就业学员中，有很多非计算机专业的、甚至之前是做家具生意的，都找到了hadoop开发工作。所以，最主要的还是你对这门技术感不感兴趣、或者说你急需一门技术来养活自己。', '2014-07-07 11:09:52');
INSERT INTO `question` VALUES ('11', '就业班', '上课时间是全天的吗？上课时间如何安排？', '答：视频课程是随报随学的，可根据自身情况安排学习时间；就业班上课时间是每周一、三、五20：30~23：00，还有周日上午9：00~12：00。', '2014-07-07 11:07:04');
INSERT INTO `question` VALUES ('10', '就业班', '超人学院目前有哪些课程？', '答：目前，超人学院两类课程：视频课程，这是吴超在传智7天课程的基础上进行拓展的，具体内容向课程咨询索取课程大纲；就业班课程：具体内容详见课程大纲。', '2014-07-07 11:06:56');
INSERT INTO `question` VALUES ('20', '就业班', '学完了找不到工作怎么办？', '答：一个人的就业，除了技术技能是最重要的因素外，人的修养、品德也是很重要的。其实，就业与否，涉及到综合因素太多了，教育背景、工作经历等等。因此，这也是任何一家培训机构，不管他的技术实力多么牛逼，也无法敢保证所有的学员全部就业的原因。', '2014-07-07 11:12:26');
INSERT INTO `question` VALUES ('21', '就业班', '毕业后发证书吗？', '答：it行业公司是非常务实的，除了毕业证、学历证、英语四六级证书，其他的证书，作为企业一般不会过多去看的。用人单位都是业内人士，也许用人单位看到想录用的人亮出那些认证，反而被用人单位鄙视，因为真正有水平的应聘者是不会用这些证书来证明自己的实力的。', '2014-07-07 11:12:55');
INSERT INTO `question` VALUES ('22', '就业班', '不签就业协议，工作有保障吗？', '答：能否找到一份好工作主要取决于你的技术和能力，并非什么书面协议或口头承诺。因为用人单位不是傻瓜，任何一家公司几乎不可能会花钱雇佣一个技术不怎么的人进去干活。\r\n签就业协议就一定能保证就业吗？我们是踏踏实实教大家技术的，不会进行那样不负责任的承诺。学习需要老师和学员双方协同完成的事情，如果只靠我们的一句“保证就业”就可以不认真学习，那真是太自欺欺人了。我们的老师要做到用心教，然后督促学员认真学，学到了技术和真本领，还愁找不到工作吗？\r\n师傅领进门，修行靠个人。学生不努力学习，谁也没办法。', '2014-07-07 11:13:24');
INSERT INTO `question` VALUES ('23', '就业班', '学费需要一次性缴清吗？可以分期付款吗？', '答：目前的缴费形式是一次性缴清的，暂时不支持分期付款。后续会考虑和第三方机构合作推出分期付款方式。', '2014-07-07 11:16:10');
INSERT INTO `question` VALUES ('24', '就业班', '学费的支付方式有哪些？', '答：目前支持支付宝和银行转账两种支付方式，报名时请向课程咨询索取相应账号。', '2014-07-07 11:15:11');
INSERT INTO `question` VALUES ('25', '就业班', 'hadoop大数据的就业前景怎么样？', '答：无论从国家的政策支持还是还是公司的投资力度来看，hadoop大数据的招聘需求在接下来的2~3年肯定越来越旺盛。目前，已经有很多学员找到了hadoop高薪工作，实现了不同程度的增值，有的学员甚至实现了薪资翻番。', '2014-07-07 11:15:39');
